import React from 'react';
import Post from './Post/Post';
const Posts = () => {
    return <div>
        <p>Posts</p>
        <textarea name="" id="" cols="30" rows="10"></textarea>
        <button>Add</button>
        <Post />
        <Post />
        <Post />
    </div>
} 

export default Posts;
